import "./App.css";
import Navbar from "./components/Navbar";
import Textform from "./components/Textform";

function App() {
	return (
		<>
			<Navbar title="TextUtils" AboutUtils="About"></Navbar>
			<div className="container">
				<Textform heading="Enter the text to" />
			</div>
		</>
	);
}

export default App;
